const fs = require('fs');
var path = require('path');
const clodinary = require('../config/clodinary');
const { default: puppeteer } = require('puppeteer');
const db = require('../models/index');
const { methodReturn } = require('../utils');
const { File } = require('buffer');
const Loan = db.sequelize.models.loan;
const logoUrl = "data:image/png;base64,";

exports.generateAgreement = async function(loanId) {
    const loan = await Loan.findOne({where:{id: loanId},
        include: [
            {association: 'lender'}, {association: 'borrower'}
        ]
    });

    const agreementDate = new Date(loan.investDate ?? new Date());
    const data = {
        loanCode: loan.id,
        logoUrl: logoUrl,
        agreementDate: formatDate(agreementDate),
        tenureMonths: loan.tenureMonths,
        maturityDate: formatDate(loan.maturityDate),
        emiStartDate: formatDate(loan.emiStartDate),
        lenderName: loan.lender.firstName + ' ' + loan.lender.lastName,
        lenderSign: loan.lender.firstName + ' ' + loan.lender.lastName + ' (' + loan.lender.email + ')' ,        
        borrowerName: loan.borrower.firstName + ' ' + loan.borrower.lastName,
        borrowerSign: loan.borrower.firstName + ' ' + loan.borrower.lastName + ' (' + loan.borrower.email + ')' ,
        loanAmount: loan.amount,
        agreementDay: agreementDate.toLocaleString('en-In', {weekday:'long'}),
        agreementMonth: agreementDate.toLocaleString('en-In', {month:'long'}),
        agreementYear: agreementDate.toLocaleString('en-In', {year:'numeric'}),
    }
    const html = buildHtml(data);

    const pdfFileName = loan.id;
    const pdf = await buildPDF(html, pdfFileName);
    if(!pdf.status){
        return pdf;
    }

    // let file = fs.readFileSync(pdf.data, 'utf-8');
    // const uploadRes = await clodinary.v2.uploader.upload(pdf.data, {access_mode: 'authenticated', folder: 'agreement',filename_override: loan.id, resource_type: 'auto'} );
    // console.log(uploadRes);
    return methodReturn(true, 'Agreement generated', {agreementUrl: pdf.data});
}

