const buildHtml = (data) => {
        const templatePath = path.resolve('src/views/agreement/template.html');
        let template = new String(fs.readFileSync(templatePath, 'utf8'));
        const noBold = ['logoUrl'];
        Object.keys(data).forEach(k => {
            if(noBold.includes(k)){
                template = template.replaceAll("{{"+k+"}}", data[k]);
            }else{
                template = template.replaceAll("{{"+k+"}}", '<b>'+data[k]+'</b>');
            }
        })

       return template;
};

const buildPDF = async (html, fileName) => {
    try {
        
        const pdfPath = path.resolve('public/agreement/'+fileName)+'.pdf';
        const browser = await puppeteer.launch({
            args: ['--font-render-hinting=none'],
        });

        const page = await browser.newPage();
        await page.setContent(html);

        // const pdf = await page.screenshot({
        //     path: pdfPath,
        //     fullPage:true,
            
        // })
        const pdf = await page.pdf({
            path: pdfPath,
            format: 'a4',
            printBackground: true,
            scale: 0.5,
        });

        await page.close();
        await browser.close();
        return methodReturn(true, 'Agreement generated', pdfPath);

    } catch (err) {
        return methodReturn(false, err.message);
    }
}

const formatDate = (date) => {
    return new Date(date).toLocaleString('en-In', {weekday:'long', month: 'long', year: 'numeric', day: 'numeric'});
}
